			if(checker == -1) continue;
			for(int k = 1; k < 8; k++) if(f[k] > x[k]) z.push_back(f[k]-x[k]);
			if(y.size() == 1){
				if(z.size() == 1) ans += 1;
				if(z.size() == 2) ans += 1;
