				if(z.size() == 1) ans += 2;
				if(z.size() == 2) ans += 6;
				if(z.size() == 3) ans += 12;
			}
		}
		ans /= 2;
		f[0] = 1;
		for(int i = 1; i < f.size(); i++){
			if(f[i] == 0) continue;
			f[i]--;
			for(int j = 0; j < (1<<16); j++){
				int J = j, checker = 0;
				vector<int> y, z;
				for(int k = 0; k < 8; k++){
					x[k] = J%4;
					if(x[k] > 0) y.push_back(x[k]);
					checker += x[k];
					J /= 4;
				}
				if(checker != 3) continue;
				for(int k = 0; k < 8; k++) if(f[k] < x[k]) checker = -1;
				if(checker == -1) continue;
				for(int k = 0; k < 8; k++) if(f[k] > x[k]) z.push_back(f[k]-x[k]);
				if(y.size() == 1){
					if(z.size() == 1) ans += 1;
					if(z.size() == 2) ans += 1;
					if(z.size() == 3) ans += 2;
				} else if(y.size() == 2){
					if(z.size() == 1) ans += 1;
					if(z.size() == 2) ans += 3;
					if(z.size() == 3) ans += 6;
				} else{
					if(z.size() == 1) ans += 2;
					if(z.size() == 2) ans += 6;
					if(z.size() == 3) ans += 12;
				}
			}
			f[i]++;
		}
	}

