int n;
vector<vi> rot = {{1, 2, 3, 0, 5, 6, 7, 4},
                  {6, 7, 1, 0, 2, 3, 5, 4}};

void dfs2(vi perm){
    if(used[perm]) return;
    used[perm] = true;

    vi next_perm(N);
    rep(i, 2){
        rep(j, N){
            next_perm[j] = perm[rot[i][j]];
        }
        dfs2(next_perm);
    }
}

void dfs(int cnt, vi & perm, vi & num_color){
    if(cnt == N){
        if(used[perm]) return;
        res++;
        dfs2(perm);
        return;
    }

    rep(i, n){
        if(num_color[i] <= 0) continue;

        num_color[i]--;
        perm[cnt] = i;
        dfs(cnt + 1, perm, num_color);
        num_color[i]++;
    }
}

