const Vector<Vector<Int>> trans{
    {0, 1, 2, 3},
    {4, 5, 6, 7},
    {0, 1, 5, 4},
    {3, 2, 6, 7}};

void rotate(Vector<String>& v, Int t) {
    for (Int i = 0; i < 2; ++i) {
        for (Int j = 0; j < 3; ++j) {
            std::swap(v[trans[t * 2 + i][j]], v[trans[t * 2 + i][j + 1]]);
        }
    }
}

Bool solve() {
    Vector<String> s(8);
    if (!(std::cin >> s[0])) return false;
    for (Int i = 1; i < 8; ++i) std::cin >> s[i];

    std::sort(s.begin(), s.end());
    Set<Vector<String>> pats;
    do {
        pats.insert(s);
    } while (std::next_permutation(s.begin(), s.end()));

    Int ans = 0;
    while (!pats.empty()) {
        s = *pats.begin();
        ++ans;

        for (Int i = 0; i < 4; ++i) {
            for (Int j = 0; j < 4; ++j) {
                for (Int k = 0; k < 4; ++k) {
                    for (Int l = 0; l < 4; ++l) {
                        pats.erase(s);
                        rotate(s, 0);
                    }
                    rotate(s, 1);
                }
                rotate(s, 0);
            }
            rotate(s, 1);
        }
    }

    std::cout << ans << std::endl;
    return true;
}

