int normalize(vector<int> color) {
  int mini = INT_MAX;
  vector<int> tmp = color;
  rep(_,4) {
    rep(__,4) {
      rep(___,4) {
	int v = 0;
	rep(i,8) { assert(color[i]); v *= 10; v += color[i]; }
	mini = min(mini,v);
	roll_x(color);
      }
      roll_y(color);
    }
    roll_z(color);
  }
  assert( tmp == color );
  return mini;
}

