void SW(int a,int b){swap(num[a],num[b]);}
void rot(){
  SW(UF,UR),SW(UR,UB),SW(UB,UL);
  SW(DF,DR),SW(DR,DB),SW(DB,DL);
}

void rot90(){
  V tmp = num;
  num[UF] = tmp[DF];
  num[UL] = tmp[DL];
  num[UB] = tmp[UL];
  num[UR] = tmp[UF];

  num[DF] = tmp[DR];
  num[DL] = tmp[DB];
  num[DB] = tmp[UB];
  num[DR] = tmp[UR];


}
void rev(){SW(UF,DB),SW(DF,UB),SW(UR,DR),SW(UL,DL);}

int VtoI(V&a=num){
  int res=0;
  for(int i=0;i<8;i++)res=res*10+num[i]+1;
  return res;
}

void RotRev(){
  for(int i=0;i<4;i++) rot(),S.insert(VtoI());
  rev();
  for(int i=0;i<4;i++) rot(),S.insert(VtoI());
  rev();

}

void Insert(){
  RotRev();
  rot90(),RotRev();
  rot(),rot90(),RotRev();
}

int check(){
  if(S.count(VtoI()))return 0;
  V tmp = num;
  Insert();
  num= tmp;
  return 1;
}

