// a,b   d ab
inline pair<P2, P2> get_same_distance_points(P2 a, P2 b, double d)
{
	assert(abs(a - b) <= 2 * d + EPS);
	auto v = (a + b) / 2.0 - a; // a  ab
	auto vl = abs(v);
	auto wl = sqrt(d*d - vl*vl); // V
	auto w = orthogonal(v) * (wl / vl); // V
	return make_pair(a + v + w, a + v - w);
}

