template<class T>
struct Dice
{
	/* v as 
	  |3|
	|1|0|4|5|
	  |2|
	*/
	T v[6];

	void rt(int x, int y, int z, int w) { swap(v[x], v[y]); swap(v[x], v[z]); swap(v[x], v[w]); }
	void rotateLeft() { rt(0, 4, 5, 1); }
	void rotateRight() { rt(1, 5, 4, 0); }
	void rotateDown() { rt(0, 3, 5, 2); }
	void rotateUp() { rt(2, 5, 3, 0); }
	void rotateCw() { rt(3, 1, 2, 4); }
	void rotateCcw() { rt(4, 2, 1, 3); }
	bool operator < (const Dice &rhs) const { return lexicographical_compare(apartof(v, 0, 6), apartof(rhs.v, 0, 6)); }
};

template<class T>
struct Octahedra
{
	/* v as 
		/0\/1\/2\/3\
		\4/\5/\6/\7/
	*/
	T v[8];

	void rt(int x, int y, int z, int w) { swap(v[x], v[y]); swap(v[x], v[z]); swap(v[x], v[w]); }
	void rotateLeft() { rt(0, 1, 2, 3); rt(4, 5, 6, 7); }
	void rotateRight() { rt(3, 2, 1, 0); rt(7, 6, 5, 4); }
	void rotateDown() { rt(0, 4, 7, 3); rt(1, 5, 6, 2); }
