    swap(a[2], a[3]);
    swap(a[4], a[5]);
    swap(a[5], a[6]);
    swap(a[6], a[7]);
}

void spindiag(vector<string> &a){
    swap(a[1], a[3]);
    swap(a[3], a[4]);
    swap(a[2], a[7]);
    swap(a[7], a[5]);
}

void turnupdown(vector<string> &a){
    swap(a[0], a[4]);
    swap(a[1], a[7]);
    swap(a[2], a[6]);
    swap(a[3], a[5]);
}

