  dc[0] = dc0[4], dc[4] = dc0[5], dc[5] = dc0[1], dc[1] = dc0[0];
  dc[2] = dc0[6], dc[6] = dc0[7], dc[7] = dc0[3], dc[3] = dc0[2];
}

