		long long tmpans = 0;
		for(int i = 1; i < f.size(); i++){
			f[i]--;
			for(int i2 = i; i2 < f.size(); i2++){
				if(f[i2] <= 0) continue;
				f[i2]--;
				int tmp = 4*3*2*1;
				for(int j = 1; j < f.size(); j++){
					if(f[j] <= 0) continue;
					for(int k = f[j]; k >= 1; k--) tmp /= k;
				}
				if(i != i2){
					tmpans += tmp;
				} else{
					vector<int> y;
					for(int j = 1; j < f.size(); j++) if(f[j] > 0) y.push_back(f[j]);
					if(y.size() == 1) tmpans += 1;
					if(y.size() == 2 && y[0] == 2) tmpans += 4;
					else{
						tmpans += tmp;
					}
				}
				f[i2]++;
			}
			f[i]++;
		}
		ans += tmpans*2;
	}

	cout << ans << endl;
}

