};

template<class T>
struct Octahedra
{
	/* v as 
		/0\/1\/2\/3\
		\4/\5/\6/\7/
	*/
	T v[8];

	void rt(int x, int y, int z, int w) { swap(v[x], v[y]); swap(v[x], v[z]); swap(v[x], v[w]); }
	void rotateLeft() { rt(0, 1, 2, 3); rt(4, 5, 6, 7); }
	void rotateRight() { rt(3, 2, 1, 0); rt(7, 6, 5, 4); }
	void rotateDown() { rt(0, 4, 7, 3); rt(1, 5, 6, 2); }
	void rotateUp() { rt(3, 7, 4, 0); rt(2, 6, 5, 2); }
	void rotateCw() { rt(0, 1, 5, 4); rt(3, 2, 6, 7); }
	void rotateCcw() { rt(4, 5, 1, 0); rt(7, 6, 1, 3); }
	bool operator < (const Octahedra &rhs) const { return lexicographical_compare(apartof(v, 0, 8), apartof(rhs.v, 0, 8)); }
};

