  vector<string> t = s;
  t[0] = s[0];
  t[1] = s[5];
  t[5] = s[3];
  t[3] = s[1];
  t[4] = s[2];
  t[2] = s[6];
  t[6] = s[4];
  t[7] = s[7];
  return t;
}

vector<string> r2(vector<string> s) {
  vector<string> t = s;
  t[0] = s[1];
  t[1] = s[2];
  t[2] = s[3];
  t[3] = s[0];
  t[4] = s[5];
  t[5] = s[6];
  t[6] = s[7];
  t[7] = s[4];
  return t;
}

vector<string> r3(vector<string> s) {
  vector<string> t = s;
  t[0] = s[5];
  t[5] = s[0];
  t[1] = s[4];
  t[4] = s[1];
  t[2] = s[7];
  t[7] = s[2];
  t[3] = s[6];
  t[6] = s[3];
  return t;
}

