    vector<int> w = this->v;
    swap(w[0],w[4]);swap(w[4],w[5]);swap(w[5],w[1]);
    swap(w[2],w[3]);swap(w[3],w[7]);swap(w[7],w[6]);
    return P(w);
  }
  P rotate3() {
    vector<int> w = this->v;
    swap(w[0],w[4]);swap(w[4],w[7]);swap(w[7],w[3]);
    swap(w[1],w[5]);swap(w[5],w[6]);swap(w[6],w[2]);
    return P(w);
  }
  vector<P> all() {
    P r = *this;
    vector<P> res;
    for (int i=0; i<6; ++i,r=(i&2?r.rotate2():r.rotate3())) {
      for (int j=0;j<4; ++j,r=r.rotate1())
        res.push_back(r);
    }
    return res;
  }
};

const bool operator<(P a, const P &b) {
  vector<P> v = a.all();
  vector<int> mi = a.v;
  FOR(it, v) {
    if (it->v == b.v) return 0;
    mi = min(mi, it->v);
  }
  return mi < b.v;
}

