void rotate(vector<int>& v, int a, int b, int c, int d){
  int t = v[a];
  v[a] = v[b];
  v[b] = v[c];
  v[c] = v[d];
  v[d] = t;
}
void rotate_x(vector<int>& v){
  rotate(v, 1, 2, 6, 5);
  rotate(v, 0, 3, 7, 4);
}
void rotate_y(vector<int>& v){
  rotate(v, 0, 1, 5, 4);
  rotate(v, 3, 2, 6, 7);
}
void rotate_z(vector<int>& v){
  rotate(v, 0, 1, 2, 3);
  rotate(v, 4, 5, 6, 7);
}
bool equal(const vector<int>& d, vector<int> e){
  for(int i = 0; i < 6; i++){
    if(i & 1) rotate_x(e);
    else rotate_y(e);
    for(int j = 0; j < 4; j++){
      rotate_z(e);
      if(d == e) return true;
    }
  }
  return false;
}
