int calchs(int c[8])
{
	int ret=0;
	for(int i=0; i<8; i++)
		ret|=c[i]<<(3*i);

	return ret;
}

class Octahedra
{
public:
	int f[8];

	void all_rotate()
	{
hs[calchs(f)]=1;
		for(int i=0; i<4; i++)
		{
			x_rot();
			for(int j=0; j<4; j++)
			{
				y_rot();
				for(int k=0; k<4; k++)
				{
					z_rot();
					hs[calchs(f)]=1;
				}
			}
		}
	}

	void x_rot()
	{
		int t1=f[0], t2=f[4];
		f[0]=f[1];
		f[1]=f[2];
		f[2]=f[3];
		f[3]=t1;

		f[4]=f[5];
		f[5]=f[6];
		f[6]=f[7];
		f[7]=t2;

	}

	void y_rot()
	{
		int t0=f[0], t1=f[1], t2=f[2], t3=f[3];
		f[0]=f[4];
		f[1]=f[5];
		f[2]=t0;
		f[3]=t1;
		f[4]=f[6];
		f[5]=f[7];
		f[6]=t2;
		f[7]=t3;
	}

	void z_rot()
	{
		int t0=f[0],t1=f[1], t2=f[2], t6=f[6];
		f[0]=f[4];
		f[1]=t0;
		f[2]=f[3];
		f[3]=f[7];
		f[4]=f[5];
		f[5]=t1;
		f[6]=t2;
		f[7]=t6;
	}

	Octahedra(int face[8])
	{
		for(int i=0; i<8; i++)
			f[i]=face[i];
	}
};

int main()
{
	int c[8];
