	while(1)
	{
		memset(hs, 0, sizeof(hs));
		int cnt=0;
		map<string, int> d;

		for(int i=0; i<8; i++)
		{
			if(!(cin >> s)) return 0;

			int color;			
			if(d.count(s) == 0)
			{
				color=cnt;
				d.insert(make_pair(s,cnt));
				cnt++;
			}
