    void rollTF(){
	swap(x[0],x[7]);
	swap(x[1],x[2]);
	swap(x[4],x[5]);
	swap(x[3],x[6]);
    }

    void rollR(){
	int tmp = x[0];
	x[0] = x[7];
	x[7] = x[2];
	x[2] = x[1];
	x[1] = tmp;

	tmp = x[3];
	x[3] = x[6];
	x[6] = x[5];
	x[5] = x[4];
	x[4] = tmp;
    }

