        for (int i = 0; i < 3; i++) 
            xs[i].resize(4);
        xs[0][0] = 0; xs[0][1] = 1; xs[0][2] = 2; xs[0][3] = 3;
        xs[1][0] = 1; xs[1][1] = 2; xs[1][2] = 7; xs[1][3] = 4;
        xs[2][0] = 0; xs[2][1] = 1; xs[2][2] = 4; xs[2][3] = 5;
    }

    void rot(vector<int>& ys) {
        int t = ys[3];
        for (int i = 3; i >= 0; i--) ys[i] = ys[i - 1];
        ys[0] = t;
    }

    void rot(vector<string>& s, int index) {
        vector<int>& from = xs[index];
        vector<int> to = xs[index];
        rot(to);
        vector<string> t = s;
        for (int i = 0; i < 4; i++) {
            s[ to[i] ] = t[ from[i] ];
            s[ 7 - to[i] ] = t[ 7 - from[i] ];
        }
    }

    void dfs(vector<string>& s, int index, set< vector<string> >& X) {
        if (index == 3) return;
        for (int i = 0; i < 4; i++) {
            X.insert(s);
            rot(s, index);
            dfs(s, index + 1, X);
        }
    }

    void solve() {
        set< vector<string> > X;
        sort(F.begin(), F.end());
        int ans = 0;
        do {
            if (X.count(F)) continue;
            ans++;
            dfs(F, 0, X);
        } while (next_permutation(F.begin(), F.end()));
        cout << ans << endl;
    }
}

