    int face[8];
    void rotate_left(){
        rotate(face, face+1, face+4);
        rotate(face+4, face+5, face+8);
    }

    void rotate_up(){
        int t = face[0];
        face[0] = face[4];
        face[4] = face[7];
        face[7] = face[3];
        face[3] = t;
        t = face[1];
        face[1] = face[5];
        face[5] = face[6];
        face[6] = face[2];
        face[2] = t;
    }

    bool equals(octa o) const {
        if(check(o)) return true;
        o.rotate_up();
        if(check(o)) return true;
        o.rotate_up();
        if(check(o)) return true;
        o.rotate_up();
        if(check(o)) return true;
        o.rotate_up();
        o.rotate_left();
        o.rotate_up();
        if(check(o)) return true;
        o.rotate_up();
        o.rotate_up();
        if(check(o)) return true;
        return false;
    }

    bool check(octa &o) const {
        rep(i,4){
            if(equal(face, face+8, o.face)) return true;
